import React from 'react';

function About() {
  return (
    <div className="min-h-screen bg-red-50 text-red-900 px-8 py-16">
      <h2 className="text-4xl font-bold mb-6 text-center">About This Project</h2>
      <p className="text-lg max-w-3xl mx-auto leading-relaxed">
        This Earthquake Dashboard provides visual insights and predictions based on historical seismic data.
        The goal is to make earthquake data more accessible and easier to understand through interactive
        tools and real-time visualizations.
      </p>
    </div>
  );
}

export default About;
